'use-strict'
import { UpdateDateColumn, CreateDateColumn } from 'typeorm'

export default abstract class BaseEntity {
  id: number | string | undefined

  @CreateDateColumn({ type: 'timestamp' })
  public created_at: string

  @UpdateDateColumn({ type: 'timestamp' })
  public updated_at?: string
}

import { BaseRepositoryInterface } from './base.repository.interface'
import { Repository } from 'typeorm'
import { ADP } from '../../helpers/adapters/adapter';

export class BaseRepository<I, E> implements BaseRepositoryInterface<I, E> {
  constructor(
    private readonly repository: Repository<E>,
    private readonly adapter: ADP<E>
  ) {}

  async findOneById(id: number): Promise<E> {
    try {
      return await this.repository.findOne(id)
    } catch (e) {
      throw new Error('Cannot find data: ' + e)
    }
  }

  async update(id: number, option: { [option: string]: any }): Promise<E> {
    throw new Error('Method not implemented.')
  }

  async findAll(data: { [key: string]: any }): Promise<E[]> {
    try {
      return await this.repository.find(data)
    } catch (e) {
      throw new Error('Error find data: ' + e)
    }
  }

  async findOne(data: { [key: string]: any }): Promise<E> {
    try {
      return await this.repository.findOne(data)
    } catch (e) {
      throw new Error('Error find data: ' + e)
    }
  }

  async create(data: I): Promise<E> {
    try {
      const entity: any = this.adapter.ifToEntityCreateCase(data) // change to entity class
      return await this.repository.save(entity)
    } catch (e) {
      throw new Error('failed to create data: ' + e)
    }
  }

  async delete(id: number): Promise<any> {
    try {
      return await this.repository.delete(id)
    } catch (e) {
      throw new Error('failed to create data: ' + e)
    }
  }
}

import { BaseServiceInterface } from './base.service.interface'
import { BaseRepository } from '../repositories/base.repository'

export class BaseService<D, E> implements BaseServiceInterface<D, E> {
  constructor(private readonly baseRepository: BaseRepository<D, E>) {}

  findAll(option: { [index: string]: any }): Promise<E[]> {
    return this.baseRepository.findAll(option)
  }

  findById(id: number): Promise<E> {
    return this.baseRepository.findOneById(id)
  }

  async create(data: D): Promise<E> {
    return await this.baseRepository.create(data)
  }

  delete(id: number): Promise<E> {
    return this.baseRepository.delete(id)
  }

  update(id: number, option: { [index: string]: any }): Promise<E> {
    return this.baseRepository.update(id, option)
  }
}

'use strict'

import { Injectable } from '@nestjs/common'

@Injectable()
export class ADP<T> {
	updateAssign(oldObj: T, newObj: BaseObject): T {
		// tslint:disable-next-line:forin
		for (const i in newObj) {
			const key = i.toString()

			key === 'id' ||
			key === 'created_at' ||
			key === 'updated_at' ||
			// tslint:disable-next-line:no-unused-expression
			key === 'deleted_at'
				? // tslint:disable-next-line:no-unused-expression
				  null
				: (oldObj[key] = newObj[key])
		}

		return oldObj
	}

	ifToEntity(obj: BaseObject): T {
		// tslint:disable-next-line:prefer-const
		let entity: T = {} as T

		// tslint:disable-next-line:forin
		for (const key in obj) {
			entity[key] = obj[key]
		}

		return entity
	}

	ifToEntityCreateCase(obj: BaseObject): T {
		// tslint:disable-next-line:prefer-const
		let entity = this.ifToEntity(obj)

		// tslint:disable-next-line:no-string-literal
		if (entity.hasOwnProperty('id')) entity['id'] = undefined

		return entity
	}
}

interface BaseObject {
	[key: string]: any
}

import {
  Controller,
  Post,
  Body,
  Get,
  HttpCode,
  Param,
  Delete,
  Patch
} from '@nestjs/common'
import { UserService } from './user.service'
import { UserDto } from './dto/user.dto'

@Controller('user')
export class UserController {
  constructor(private readonly userService: UserService) {}

  @Post() // POST user/
  @HttpCode(201)
  create(@Body() request: UserDto) {
    return this.userService.create(request)
  }

  @Get() // GET user/
  getAll(@Body() option?: UserDto) {
    return this.userService.findAll(option)
  }

  @Get(':id') // GET user/{id}
  finById(@Param('id') id) {
    return this.userService.findById(id)
  }

  @Delete(':id') // Delete user/{id}
  deleteById(@Param('id') id) {
    return this.userService.delete(id)
  }

  @Patch(':id') // PATCH user/{id}
  update(@Param() param) {
    return this.userService.update(param.id, param)
  }
}

import BaseEntity from '../common/entity/base.entity'
import { Column, PrimaryGeneratedColumn, Entity } from 'typeorm'
import { IUser } from './interfaces'

@Entity()
export class Users extends BaseEntity implements IUser {
  @PrimaryGeneratedColumn({ type: 'int' })
  id: number

  @Column('varchar') first_name: string

  @Column('varchar') last_name: string

  @Column('varchar') email: string

  @Column('varchar') password: string
}

import { BaseRepository } from '../common/repositories/base.repository'
import { InjectRepository } from '@nestjs/typeorm'
import { Repository } from 'typeorm'
import { Users } from './user.entity'
import { Injectable } from '@nestjs/common';
import { ADP } from '../helpers/adapters/adapter';
import { UserDto } from './dto/user.dto';

@Injectable()
export class UserRepository extends BaseRepository<UserDto, Users> {
  constructor(
    @InjectRepository(Users)
    private readonly userRepository: Repository<Users>,
    adapter: ADP<Users>
  ) {
    super(userRepository, adapter)
  }
}

